In the following Logan wrote **_pressure_gradient(coupledGradient("pressure")),** in the DarcyVelocity AuxKernel file.
I can see material is with AD, why do not we have ad for pressure such as **_pressure_gradient(adCoupledGradient("pressure")),**
In the opposite way, can we remove the AD from the _permeability(getADMaterialProperty("permeability")), etc?
Thanks.

DarcyVelocity::DarcyVelocity(const InputParameters & parameters)
: VectorAuxKernel(parameters),
// Get the gradient of the variable
**_pressure_gradient(coupledGradient("pressure")),**
// Set reference to the permeability MaterialProperty.
// Only AuxKernels operating on Elemental Auxiliary Variables can do this
_permeability(getADMaterialProperty("permeability")),
// Set reference to the viscosity MaterialProperty.
// Only AuxKernels operating on Elemental Auxiliary Variables can do this
_viscosity(getADMaterialProperty("viscosity"))
{}
RealVectorValue
DarcyVelocity::computeValue()
{
// Access the gradient of the pressure at this quadrature point, then pull out the
"component" of
// it requested (x, y or z). Note, that getting a particular component of a
gradient is done using
// the parenthesis operator.
return -MetaPhysicL::raw_value(_permeability[_qp] / _viscosity[_qp]) *
_pressure_gradient[_qp];

